import axios from 'axios';

const userInstance = axios.create({
  baseURL: 'http://localhost:8080/users/',
  headers: {
    'Content-Type': 'application/json',
  },
});

const categoryInstance = axios.create({
  baseURL: 'http://l'
})

export default userInstance;
